MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "This manual describes Standard Verification Rule Format (SVRF) syntax and command descriptions used with Calibre and ICverify products. ");
MGCAddSnippet(6, "This manual is written for anyone writing rule files for use with Calibre and ICverify tools to perform physical verification, parasitic extraction, manufacturability analysis, optical correction, and mask verification. This manual assumes that you are already familiar with the general verification requirements for your designs. If you are using Pyxis Layout, this manual assumes you are already familiar with the tool.");
MGCAddSnippet(7, "The following summary of Siemens Digital Industries Software documentation conventions will facilitate your reading of Calibre manuals. These conventions apply to functions, commands, key names, pathnames, menu paths, transcripts, and notational information.");
MGCAddSnippet(8, "The command descriptions for SVRF statements use font properties and several meta-characters to document the command syntax. ");
MGCAddSnippet(9, "ICverify application functions referred to in the SVRF Manual start with an optional  $  character and use italic font to indicate an argument that is replaced by the user. ");
MGCAddSnippet(10, "Most Siemens EDA pathnames use shell environment variables, such as $MGC_GENLIB and $PROJECT_XYZ. The pathnames generally point to shared network resources. The dollar sign indicates dereferencing of the environment variable, and the environment variable itself is shown in capital letters, in keeping with the industry-standard practice. ");
MGCAddSnippet(11, "This chapter covers the basic concepts needed to write and use a SVRF rule file for the Calibre and ICverify products. ");
MGCAddSnippet(12, "The Calibre and ICverify products use a Standard Verification Rule Format (SVRF) file (or rule file for short). The rule file governs Calibre tool processing of your design. ");
MGCAddSnippet(13, "Prior to its use by a verification application, the rule file must be compiled. This is automatic in Calibre applications and is performed by the LOAd RUles command in Pyxis Layout. Compilation involves checking that all syntax is correct, checking that all layers are of the correct type for a particular operation, ensuring there are no incorrect settings, and so forth. This process results in a compiled image of the rule file that is suitable for execution of its constituent operations by the applications.");
MGCAddSnippet(14, "At the lowest level, all elements in the rule file (except pre-processor directives, macros, and Include statements, which are processed in the first phase of compilation) are either keywords, numbers, string constants, or names. The topics in this section discuss the details for command parsing, numeric expressions and constraints, and variable usage.");
MGCAddSnippet(15, "During compilation, all keywords that are symbols from the following set are recognized immediately regardless of the absence of surrounding whitespace.");
MGCAddSnippet(16, "Comments are permitted in the rule file to annotate the source code. Two slash characters (//) start a comment that terminates at the end of the line on which they occur. Multiline C-style comments (/* … */) are also permitted. ");
MGCAddSnippet(17, "Certain SVRF layer operations are measurement-oriented and therefore carry constraints. Constraints are ranges of non-negative real numbers; input data that falls within the specified constraint of an operation is generally output as result data. ");
MGCAddSnippet(18, "A numeric expression can specify any numeric parameter in any layer operation. Numeric expressions can also be used to define variables in a Variable specification statement. Numeric expressions may be used as numeric parameters in many specification statements and in functions used by various built-in languages used within SVRF statements.");
MGCAddSnippet(19, "Some SVRF elements have lists of x y coordinate pairs as parameters. In certain cases, negative numbers must be enclosed in parentheses. ");
MGCAddSnippet(20, "A string constant is a sequence of one or more characters enclosed in quotation marks (   ) or single quotes (   ). A string constant can be used wherever a name is required and, in that context, is treated as a name regardless of the characters that comprise it. This allows names to coincide with SVRF keywords or numbers, or to contain symbols of the language. ");
MGCAddSnippet(21, "An SVRF rule file supports two types of variables: those declared in a Variable statement and environment variables.");
MGCAddSnippet(22, "When specifying a pathname parameter in a rule file statement, you can use an environment variable as a component of the filename (this does not apply to ICverify). The environment variable is signified by preceding it with a dollar sign ($). The tool evaluates the environment variable at compilation time and substitutes it into the filename string. ");
MGCAddSnippet(23, "You can abbreviate some of the words in an SVRF keyword set. Abbreviations are warranted when the word is long and cumbersome or its expected frequency of use is high. Abbreviations take the form of some prefix of the word to be abbreviated. They are also selected so as not to conflict with common layer names. Abbreviations are generally shown when the keyword is first introduced and are indicated by a subset of the keyword s letters shown in uppercase.");
MGCAddSnippet(24, "User names (for example, those for layers, rule checks, and cells) cannot generally conflict with keywords of the rule file language because precedence rules always recognize keywords before names. User names cannot conflict with or contain symbols of the language, such as the closing brace (}). String constants can be used in place of names to remedy such a conflict, if it occurs.");
MGCAddSnippet(25, "The statements and operations that drive the Calibre tool are stored in a text file. You prepare this file, called the rule file, using any text editor. When the rule file is loaded, it is checked for syntax and other errors, and compiled. Because the compiler processes a rule file as a single entity, the order in which the elements are presented is generally not important. However, there are certain situations where elements are order-dependent. ");
MGCAddSnippet(26, "A SVRF rule file includes elements such as layer assignments and definitions, rule checks, comments, specification statements, device recognition statements, conditionals, and macros. ");
MGCAddSnippet(27, "Pre-processor directives, also known as conditionals, include rule file compiler directives for technology process control, version control, and environment variables. ");
MGCAddSnippet(28, "The portions of the rule file that Calibre or ICverify compiles can be controlled with the #DEFINE, #UNDEFINE, #IFDEF, #IFNDEF directives within your rule file. These directives define and undefine variables and provide conditional execution based on the variable definition. Variables for compilation control can also be defined as environment variables in the shell. Usage information and examples are provided. ");
MGCAddSnippet(29, "The #DEFINE pre-processor directive defines variables in the SVRF rule file. The variables are used to control conditional execution of portions of the rule file.");
MGCAddSnippet(30, "The #UNDEFINE pre-processor directive undefines variables in the SVRF rule file. The variables are used to control conditional execution of portions of the rule file.");
MGCAddSnippet(31, "The #IFDEF (if defined) and #IFNDEF (if not defined) pre-processor directives provide conditional compilation of the SVRF rule file based on variable definitions. ");
MGCAddSnippet(32, "The #IFDEF CALIBRE_VERSION pre-processor directive provides conditional compilation based upon the Calibre version, allowing for easier integration of new functionality into existing SVRF files. ");
MGCAddSnippet(33, "The #PRAGMA ENV pre-processor directive defines the default value for an environment variable used in SVRF statements.");
MGCAddSnippet(34, "Macros are functional templates, like subroutines, that can be called multiple times in a rule file. They are similar to the macros of the C and C++ languages. There is a macro definition called DMACRO, which contains rule file code, and a call to the macro, called CMACRO, which can pass arguments to the DMACRO. These structures support a modular organization of the rule file. This can be convenient when layer operations or Device statements are executed multiple times with varying parameters.");
MGCAddSnippet(35, "This chapter provides summary information on the main elements in a SVRF rule file. Tables list the SVRF statements and operations in each category, along with a short description of the command. ");
MGCAddSnippet(36, "Layer operations are functions which, when evaluated, create a derived layer from other derived layers or original layers. ");
MGCAddSnippet(37, "There are two types of layer operations: dimensional check operations and auxiliary operations. The output of these operations falls into three categories: error-directed, edge-directed, and polygon-directed. ");
MGCAddSnippet(38, "The dimensional check operations generate derived layers by measuring the separation of edges on one- or two-input layers. The dimensional check layer operations are summarized in this section. ");
MGCAddSnippet(39, "Any layer operation that is not a dimensional check layer operation is an auxiliary operation. The auxiliary layer operations generally use some type of Boolean or topological property to analyze edge or polygon relationships. ");
MGCAddSnippet(40, "Connectivity extraction statements define the electrical connectivity and net names of a design. They support many varied applications including on-the-fly connectivity maintenance within ICverify, connectivity-based dimensional check operations within the Calibre nmDRC system, parasitic extraction operations, and LVS. This section summarizes the connectivity extraction statements. ");
MGCAddSnippet(41, "This section summarizes the Virtual Connect specification statements. These form a single net from two or more (disjoint) nets that either share the same (case insensitive) name, or a portion of a name when a colon (:) or semicolon (;) is present. Used by all Calibre and ICverify applications except where noted.");
MGCAddSnippet(42, "Devices are defined for recognition and LVS comparison by the Device statement.");
MGCAddSnippet(43, "This section summarizes the statements that pertain to mask data preparation, including database fracturing and mask verification.");
MGCAddSnippet(44, "This section summarizes the statements used for optical and process correction. Most commands are documented in their corresponding RET product manuals (Calibre OPCpro, Calibre nmOPC, Calibre OPCverify, and so on). ");
MGCAddSnippet(45, "Specification statements describe the working environment for applications using the rule file. They control how data are processed.");
MGCAddSnippet(46, "This section lists the specification statements that apply to Calibre DFM applications (Calibre YieldAnalyzer and Calibre YieldEnhancer).");
MGCAddSnippet(47, "This section lists the Calibre nmDRC specification statements. This a category of specification statements used for setting or modifying operating parameters for the Calibre nmDRC system.");
MGCAddSnippet(48, "This section lists the Electrical Rule Check (ERC) specification statements. These specification statements set the operating parameters for the ERC system. ERC is performed as a part of LVS.");
MGCAddSnippet(49, "This section lists the layout database specification statements. These are specification statements used to describe contents of layout databases, pathnames, manipulation of layout objects, global flagging of error conditions in the layout, hierarchy management of cells and layers, and layout input control.");
MGCAddSnippet(50, "This section lists the LVS specification statements. These are specification statements used in layout versus schematic checking.");
MGCAddSnippet(51, "This section lists the specification statements for Calibre PERC. Most LVS specification statements also affect Calibre PERC.");
MGCAddSnippet(52, "This section lists the PEX specification statements. These statements are used in parasitic extraction applications.");
MGCAddSnippet(53, "This section lists the PEX inductance specification statements. These statements are used by Calibre xL to extract parasitic inductance.");
MGCAddSnippet(54, "This section lists the Unit specification statements. These specify the preferred units used in interpreting appropriate numeric values for capacitance, length, resistance, and time. ");
MGCAddSnippet(55, "This section lists the remaining specification statements that are not listed in the previous tables.");
MGCAddSnippet(56, "This chapter contains descriptions for the statements and operations that can be used in a rule file. These appear in alphabetical order and this chapter contains those starting with letters A through F.");
MGCAddSnippet(57, "Boolean operation that constructs the polygon area from the input layers intersected by multiple polygonal areas.");
MGCAddSnippet(58, "Selects edges whose smaller angle magnitude with the x-axis of the coordinate system satisfies the given constraint.");
MGCAddSnippet(59, "Selects polygons that meet an area constraint.");
MGCAddSnippet(60, "Transfers connectivity information from one layer to another. Used primarily for text label attachment.");
MGCAddSnippet(61, "Determines the vertical order of layers for capacitance calculations from bottom to top. ");
MGCAddSnippet(62, "Selects edges or portions of edges that coincide with an edge from a second layer.");
MGCAddSnippet(63, "Selects edges or portions of edges that coincide with an edge from a second layer and having the same interior side.");
MGCAddSnippet(64, "Selects edges or portions of edges that coincide with an edge from a second layer and having the opposite interior side.");
MGCAddSnippet(65, "Defines electrical connections on input layers.");
MGCAddSnippet(66, "Selects edges dependent on the number of convex endpoints, edge length, angle of abutting edge, and length of abutting edge.");
MGCAddSnippet(67, "Selects a layer and generates a copy of it.");
MGCAddSnippet(68, "Selects polygons that share some, but not all of their area with polygons from a second layer.");
MGCAddSnippet(69, "Constructs a derived polygon layer by replacing skew edges with sequences of orthogonal or 45-degree edges. Used only in Calibre applications.");
MGCAddSnippet(70, "Constructs a derived polygon layer by measuring the density of an input layer within a user-specified window over a specified region of the design.");
MGCAddSnippet(71, "Constructs a representation of the input layer that shows density values after applying convolution algorithms. Convolution is a mathematical procedure that produces a weighted moving average of two functions. In this case it evaluates the density value of a density window by taking into consideration the values of those windows surrounding it. Therefore, the density values are  spread out  to nearby density windows.");
MGCAddSnippet(72, "Defines devices and calculates properties for circuit extraction.");
MGCAddSnippet(73, "Generates a layer that contains seed shapes from all device instances with the specified type and model name. Seed shapes are those from device_layer arguments in Device operations. Used only in Calibre nmLVS/Calibre nmLVS-H, Calibre YieldAnalyzer, and ICtrace.");
MGCAddSnippet(74, "The commands in this section begin with  DFM. ");
MGCAddSnippet(75, "Identifies areas on a layout where manufacturing yield can potentially be improved. ");
MGCAddSnippet(76, "Specifies requirements for various rule file objects and generates a compiler error if the requirements are not met.");
MGCAddSnippet(77, "This is a Calibre Multi-Patterning command. Refer to  DFM BALANCE  in the Calibre Multi-Patterning User s and Reference Manual for a complete description of this command.");
MGCAddSnippet(78, "Calculates a numeric critical area value on one or more input layers and outputs a layer containing a DFM property named CAF that reports critical area values. ");
MGCAddSnippet(79, "Characterizes how close to circular the polygons on the input layer are. For each input polygon, the operation finds two concentric circles: one is the minimum enclosing circle and the other is the largest circle that is contained within the polygon. The radii of these two circles are reported as DFM properties attached to the output layer. Annular shapes are also identified. By default the output layer is a copy of the input layer, with properties attached to each polygon. ");
MGCAddSnippet(80, "Groups geometries on a layer by one or more specified DFM properties and outputs a representative geometry from each group. Each output geometry is annotated with a numeric property named  Class  that contains the group number. ");
MGCAddSnippet(81, "This is a Calibre Multi-Patterning command. Refer to  DFM CLUSTER  in the Calibre Multi-Patterning User s and Reference Manual for a complete description of this command.");
MGCAddSnippet(82, "Generates a derived polygon layer defined by the contour specifications in DFM Spec Contour. A set of output layers provide a contour map of a DFM property value or layer density. ");
MGCAddSnippet(83, "Copies input layers to a new layer. The type of input layer can be changed in the output.");
MGCAddSnippet(84, "Creates polygons on a new layer in a DFM database. Only used within the context of the dfm::new_layer Calibre YieldServer command.");
MGCAddSnippet(85, "Calculates and outputs critical areas associated with open and short circuits for manufacturing defect analysis. ");
MGCAddSnippet(86, "Specifies the path to the DFM database directory or the parent directory of a set of DFM databases. ");
MGCAddSnippet(87, "Specifies default options for subsequent DFM RDB or DFM Fill operations.");
MGCAddSnippet(88, "Measures the density of the input layer(s) within a user-specified window. The density value is attached as a DFM Property to an output polygon for each window where the density value meets a specified constraint. A user-defined expression may be specified instead of the default density calculation. ");
MGCAddSnippet(89, "This is a Calibre Double Patterning command. Refer to  DFM DP  in the Calibre Multi-Patterning User s and Reference Manual for a complete description of this command.");
MGCAddSnippet(90, "Performs a voltage-dependent External operation on the input layer(s). Edge pairs that satisfy both the external constraint and the voltage constraint are output. Voltages are determined by properties attached to a net-indexed input layer.");
MGCAddSnippet(91, "Writes layer data to an ASCII format results database (RDB). The results database is organized to assist in analyzing results from a DFM DV operation. ");
MGCAddSnippet(92, "Collects DFM property data from input layers and generates an output layer with net ID and voltage information. The output layer is used by DFM DV with the OVERRIDE keyword to override certain voltage values, typically for analog applications. ");
MGCAddSnippet(93, "Expands edges into polygons based on DFM properties attached to the input layer. ");
MGCAddSnippet(94, "Generates expanded enclosure regions for vias. Specifically, the operation creates a new derived polygon layer containing the regions representing these expanded enclosures. The operation preserves node numbers on the via layer. ");
MGCAddSnippet(95, "Creates a derived polygon layer containing fill polygons generated according to a fill specification. ");
MGCAddSnippet(96, "Specifies a user-defined function that can be referenced within expressions for DFM Analyze, DFM Property, or other DFM Function statements.");
MGCAddSnippet(97, "Outputs a derived polygon layer that represents areas susceptible to producing open or short circuits in the presence of random particles of a given radius. ");
MGCAddSnippet(98, "Creates a derived polygon layer by expanding polygons on the input layer. Expansion occurs by a specified step size until a target area or iteration count is met. Expanded edges must meet a specified spacing constraint. This operation is a non-node-preserving layer constructor. ");
MGCAddSnippet(99, "Analyzes the distribution of DFM Property values, computes a histogram of property values, and prints the histogram data to a text file. ");
MGCAddSnippet(100, "Creates an output layer from which jogs have been removed based on specified criteria. ");
MGCAddSnippet(101, "Specifies the maximum number of warning messages generated for a single message type. Used only with LEF/DEF input in flows that generate a DFM database (DFMDB). ");
MGCAddSnippet(102, "Performs single-layer, table-based width and spacing checks. ");
MGCAddSnippet(103, "Generates a merged copy of the input layer.");
MGCAddSnippet(104, "This is a Calibre Multi-Patterning command. Refer to  DFM MP  in the Calibre Multi-Patterning User s and Reference Manual for a complete description of this command.");
MGCAddSnippet(105, "This is a Calibre Multi-Patterning command. Refer to  DFM MPSTITCH  in the Calibre Multi-Patterning User s and Reference Manual for a complete description of this command.");
MGCAddSnippet(106, "Converts a layer containing DFM properties into a Net Area Ratio Accumulate (NARAC) layer.");
MGCAddSnippet(107, "Generates an optimized fill layer for variable-sized rectangular fill shapes. The optimization criteria is defined by DFM Spec Optimize and DFM Spec Optimize Data. ");
MGCAddSnippet(108, "Performs an OR operation on the input polygon layers and includes DFM properties from the input layers on the output layer. Properties are merged if conflicting property values exist on overlapping polygons from different layers. Optional keywords specify the method for merging properties. ");
MGCAddSnippet(109, "Performs a Boolean OR operation on edges from the input layers. Input layers may be polygon, edge, or error layers, or any combination of these layer types. Edge direction is considered. Used primarily in Calibre YieldEnhancer applications.");
MGCAddSnippet(110, "Creates a polygon layer that represents the input layer broken into rectangles, triangles, and trapezoids. The output shapes meet specified criteria for minimum size and separation. Jogs are removed from the input layer shapes before partitioning. ");
MGCAddSnippet(111, "Analyzes the symmetry of target layer shapes at marked locations. Keywords define the content of the output layer.");
MGCAddSnippet(112, "Captures patterns based on specified lithographic hotspots or based on a specified mask layer.");
MGCAddSnippet(113, "Identifies and classifies patterns based on interactions between polygons on target layers and a seed or pattern mask layer. The seed or pattern mask layer polygons are written to the output layer with an attached pattern class property. You can optionally save the classified patterns to a pattern library.");
MGCAddSnippet(114, "Generates a comma-separated values (CSV) file that summarizes the matching statistics from a pattern matching run. ");
MGCAddSnippet(115, "Associates user-defined properties to individual objects on the input layer and creates a derived layer containing only those objects that meet the specified criteria.");
MGCAddSnippet(116, "Manipulates unmerged polygon layers. Unmerged polygon layers can be created with DFM Text, DFM Copy REGION UNMERGED, and other DFM layer operations. ");
MGCAddSnippet(117, "Creates an empty polygon layer containing DFM properties calculated from one or more input layers having connectivity information and possibly DFM properties. Properties are reported per net in the output layer.");
MGCAddSnippet(118, "Creates a derived layer containing those geometries from the specified select layer that meet specified criteria. The select layer may be a secondary layer or the result of an edge or extent layer derivation from the secondary or primary layer. DFM properties are calculated and attached to the output layer. ");
MGCAddSnippet(119, "Creates a polygon layer with no physical geometries and containing user-defined DFM properties calculated from one or more input layers. ");
MGCAddSnippet(120, "Writes original or derived layer data to a results database (ASCII by default). ");
MGCAddSnippet(121, "Writes original or derived layer data to a custom-formatted text file. ");
MGCAddSnippet(122, "Backannotates objects (such as VIA, NET, and FILL enhancement shapes) from Calibre layer operations to a new incremental or full DEF layout. You directly merge backannotation enhancement shapes with an existing DEF or generate an incremental DEF to read in a place and route tool. ");
MGCAddSnippet(123, "Reads layout properties in the input database and converts them to DFM properties. The output layer is an unmerged polygon layer with attached DFM properties.");
MGCAddSnippet(124, "Generates an output layer consisting of rectangles with the specified dimensions and spacing, where these parameters can be provided by explicit numeric values or by DFM properties attached to the input layer. The rectangles are generated within the polygons on an input layer. ");
MGCAddSnippet(125, "Identifies redundant or non-redundant polygons on a layout and produces a derived polygon layer containing the identified polygons. ");
MGCAddSnippet(126, "Removes edges shorter than a specified value from the input polygons and outputs the resulting polygons. ");
MGCAddSnippet(127, "Divides an edge layer into segments. In Syntax 1, segmentation is done by count of segments. In the Syntax 2, the edge is divided into alternating primary and gap segments with specified lengths. ");
MGCAddSnippet(128, "Selects polygons from the first input layer according to node number, where the node numbers must match those provided by the second input layer. The second input layer may be a net-indexed selector layer produced by DFM Property Net or a layer with net ID properties. ");
MGCAddSnippet(129, "Specifies the rule checks to perform when Calibre is run in DFM mode.");
MGCAddSnippet(130, "Shifts the input layer based on DFM properties attached to the input layer or explicit numeric values. ");
MGCAddSnippet(131, "Shifts edges based on DFM properties attached to the input layer. The output can be an error layer with two-edge or single-edge clusters, or a derived edge layer. ");
MGCAddSnippet(132, "Oversizes or undersizes the polygons on the input layer by the amount specified. The size value is specified by a DFM property attached to the input layer polygons. ");
