MGCAddSnippet(812, "SVRF supports several built-in languages for user-defined calculations. They are used for tasks such as device property computations, device reduction computations, and device property tracing.");
MGCAddSnippet(813, "The built-in languages have common features that are important to know when writing code. These include structural and syntactical concepts that govern how programs can be written.");
MGCAddSnippet(814, "The following are the numeric functions available in the built-in languages.");
MGCAddSnippet(815, "Testing for equality of floating-point numeric values using the == operator requires care because the floating-point representation of a number is not necessarily equal to the arithmetic value. Additionally, floating-point representations of numbers can vary depending on the operating system and host hardware. The solution for equality testing is to check if values are within a certain tolerance range of each other that guarantees the necessary precision for the evaluation of equivalence.");
MGCAddSnippet(816, "The Device statement supports user-defined device property computations. This optional section consists of a program that defines device properties. The properties are written to extracted SPICE netlists and used in LVS comparison.");
MGCAddSnippet(817, "By default, the only properties available for a PMOS transistor are the effective width (W) and length (L) of the gate. Additional properties can be computed in a program. When such a program is used, W and L must be computed in addition to the other properties.");
MGCAddSnippet(818, "The device property computation language has syntactical and structural details that are important to understand when writing programs. These details are discussed in the following table.");
MGCAddSnippet(819, "Data used in device property computations can come from numerous sources. ");
MGCAddSnippet(820, "Most of the functions take one or more arguments that are references to either a layer or a pin. When referencing a pin, the compiler uses the name specified in the Device operation. When referencing a layer, the compiler uses the name or number of the layer only if it matches the name or number in the layer list of the Device operation. If the reference could be interpreted as either a pin or a layer, the pin interpretation is chosen.");
MGCAddSnippet(821, "The TVF functional interface calculates advanced device properties. The Device property computation and annotation languages call Tcl procedures defined in TVF Function statements in the SVRF rule file in order to calculate the properties.");
MGCAddSnippet(822, "A variety of built-in functions provide access to geometric and connectivity information about an instance. You can use these functions within numeric, string, or complex expressions. Numeric results can be used as an argument to a relational operator.");
