MGCAddSnippet(847, "The Device annotation built-in language is useful for MOS device well proximity and shallow trench isolation (STI) stress effect property calculations and similar applications. It is primarily used to extract physical parameters for the newer BSIM4 models. ");
MGCAddSnippet(848, "The following is a basic example of a device annotation program using Device Layer ANNOTATE. Only one annotation program is allowed per Device Layer operation. Annotation specifications cannot be shared by multiple Device Layer operations.");
MGCAddSnippet(849, "The following table shows high-level structural information specific to the device annotation built-in language.");
MGCAddSnippet(850, "Data used in device property annotation programs can come from numerous sources. ");
MGCAddSnippet(851, "The Device Layer ANNOTATE operation and the Device statement s device_annotation_program support data access functions that are used in conjunction with the DFM Property operation to retrieve values for use within device property computations. This capability is part of the TVF functional interface for device property computation. For vector functions, there are corresponding functions for converting DFM vector properties into Device enclosure function measurement format.");
MGCAddSnippet(852, "The Device Annotation Built-In Language provides a means for combining DFM Property measurements with devices recognized using Calibre nmLVS. DFM Property is an efficient and versatile operation for collecting and combining complex device property measurements used in parasitic extraction flows.");
MGCAddSnippet(853, "A variety of built-in functions, which are based upon DFM properties, provide access to geometric and connectivity information. You can use these functions within numeric, string, or complex expressions for device property computation. Numeric results can be used as arguments to relational operators.");
MGCAddSnippet(854, "Enables debug monitoring during device annotation computation.");
MGCAddSnippet(855, "Returns a derived polygon layer representing the extent of the input layout design. This extent is ignored in the context of a specified set of parameterized device cells (pcells).  This function is only used in parasitic extraction flows that use pre-characterized device models for cells that require a specific layer (typically substrate) not to be present. This function is always called in the context of a tvf::SETLAYER command and is part of the CalibreDFM_Device Tcl package. This function is incompatible with the LVS Box GRAY keyword.");
