MGCAddSnippet(860, "Converts DFM-style rectilinear measurement vectors into scaled Device enclosure-vector-style width and length measurements.");
MGCAddSnippet(861, "Returns a layer containing a DFM property vector of numbers that correspond to edge enclosure measurements for device seed shapes. The output layer is used as an auxiliary layer argument (or to derive such a layer) in a Device statement. This function may only be called in a tvf::SETLAYER command.");
MGCAddSnippet(862, "Returns a layer containing a DFM property vector of numbers that correspond to edge enclosure measurements parallel to device seed shape edges. The output layer is an edge layer with DFM vector properties used to derive an auxiliary layer argument in a Device statement. This function may only be called in the context of a tvf::SETLAYER command.");
MGCAddSnippet(863, "Returns a layer containing a DFM property vector of numbers that correspond to edge enclosure measurements perpendicular to device seed shape edges. The output layer is an edge layer with DFM vector properties used to derive an auxiliary layer argument in a Device statement. This function may only be called in the context of a tvf::SETLAYER command.");
MGCAddSnippet(864, "Enables access to DFM Function TABLE and MATRIX functions to assign device property values.");
MGCAddSnippet(865, "Returns a derived edge layer containing marker edges coincident with the bottom edges of device seed shapes (where  bottom  can change due to cell placement transformations, but is always consistent with a certain device edge). Input layers must be rectangular with edges parallel to the database axes. Pin shapes must be coincident with edges of seed shapes on each side of a seed shape. Devices that do not conform to these criteria cause the function to have empty output. This function is always called in the context of a tvf::SETLAYER command.");
MGCAddSnippet(866, "Returns a derived polygon layer containing marker shapes coincident with the bottom-left corners of device seed shapes (where  bottom  and  left  can change due to cell placement transformations, but is always consistent with a certain corner). Input layers must be rectangular with edges parallel to the database axes. Pin shapes must be coincident with edges of seed shapes on each side of a seed shape. Devices that do not conform to these criteria cause the function to have empty output. This function is always called in the context of a tvf::SETLAYER command.");
MGCAddSnippet(867, "Returns a derived edge layer containing marker edges coincident with the left edges of device seed shapes (where  left  can change due to cell placement transformations, but is always consistent with a certain device edge). Input layers must be rectangular with edges parallel to the database axes. Pin shapes must be coincident with edges of seed shapes on each side of a seed shape. Devices that do not conform to these criteria cause the function to have empty output. This function is always called in the context of a tvf::SETLAYER command.");
MGCAddSnippet(868, "Returns a derived polygon layer containing marker shapes coincident with the top-left corners of device seed shapes (where  top  and  left  can change due to cell placement transformations, but is always consistent with a certain corner). Input layers must be rectangular with edges parallel to the database axes. Pin shapes must be coincident with edges of seed shapes on each side of a seed shape. Devices that do not conform to these criteria cause the function to have empty output. This function is always called in the context of a tvf::SETLAYER command.");
MGCAddSnippet(869, "Returns a derived polygon layer containing marker shapes coincident with the bottom-right corners of device seed shapes (where  bottom  and  right  can change due to cell placement transformations, but is always consistent with a certain corner). Input layers must be rectangular with edges parallel to the database axes. Pin shapes must be coincident with edges of seed shapes on each side of a seed shape. Devices that do not conform to these criteria cause the function to have empty output. This function is always called in the context of a tvf::SETLAYER command.");
MGCAddSnippet(870, "Returns a derived edge layer containing marker edges coincident with the right edges of device seed shapes (where  right  can change due to cell placement transformations, but is always consistent with a certain device edge). Input layers must be rectangular with edges parallel to the database axes. Pin shapes must be coincident with edges of seed shapes on each side of a seed shape. Devices that do not conform to these criteria cause the function to have empty output. This function is always called in the context of a tvf::SETLAYER command..");
MGCAddSnippet(871, "Returns a derived polygon layer containing marker shapes coincident with the top-right corners of device seed shapes (where  top  and  right  can change due to cell placement transformations, but is always consistent with a certain corner). Input layers must be rectangular with edges parallel to the database axes. Pin shapes must be coincident with edges of seed shapes on each side of a seed shape. Devices that do not conform to these criteria cause the function to have empty output. This function is always called in the context of a tvf::SETLAYER command.");
MGCAddSnippet(872, "Returns a derived edge layer containing marker edges coincident with the top edges of device seed shapes (where  top  can change due to cell placement transformations, but is always consistent with a certain device edge). Input layers must be rectangular with edges parallel to the database axes. Pin shapes must be coincident with edges of seed shapes on each side of a seed shape. Devices that do not conform to these criteria cause the function to have empty output. This function is always called in the context of a tvf::SETLAYER command.");
MGCAddSnippet(873, "Returns the numeric value associated with a property.");
