MGCAddSnippet(883, "The LVS Reduce family of specification statements supports an optional user-defined program that defines the calculations to take place during device reduction. The program is written in the device reduction effective property computation language, which is often simply called the effective property language.");
MGCAddSnippet(884, "The following example illustrates many of the features of the standard (non-Tcl) language. In the explanations that follow, the term input group refers to the set of devices being reduced to a single instance. Effective property values are calculated based upon this input group and stored on the resulting (effective) instance. ");
MGCAddSnippet(885, "The following table shows information specific to the effective property computation language.");
MGCAddSnippet(886, "Data used in effective property computations can come from several sources. ");
MGCAddSnippet(887, "You use vector functions to evaluate an expression across all N instances in the input group. The resulting set of N expressions can be summed, multiplied, searched for a minimum, or searched for a maximum. You can count the number of instances in the input group with the count() function. ");
MGCAddSnippet(888, "When no effective property computation section is present in device reduction specification statements, string properties are reduced.");
MGCAddSnippet(889, "String properties have several limitations in the effective property computation language.");
MGCAddSnippet(890, "The following rule file examples illustrate effective property computations in standard form.");
MGCAddSnippet(891, "Effective property computation can be performed using runtime TVF. The decision to use TVF is based upon the need for Tcl-based functions, such as bitwise comparison functions, that are not available in the standard effective property computation language. ");
MGCAddSnippet(892, "TVF effective property programs use the foreach_instance and set_effective_property functions. These functions are used in a Tcl procedure called by TVF_NUMeric_FUNction. They control iteration over device instances and assignment of effective property values, respectively. These functions may only be used in a TVF Function block.");
MGCAddSnippet(893, "When properties are not present in the input netlist, those properties are seen with a special MISSING value within the LVS module. Errors in calculations involving MISSING properties result in the special UNKNOWN property value. ");
MGCAddSnippet(894, "When the rule file is compiled, TVF Function blocks called by the effective property programming language are compiled by the interpreter. If these fail to compile, a Tcl error is printed to the transcript.");
MGCAddSnippet(895, "The rule file compiler performs semantic checking for properties referenced in device reduction programs. ");
MGCAddSnippet(896, "A variety of built-in functions facilitate device reduction. You can use these functions within numeric, string, or complex expressions. Numeric results can be used as an argument to a relational operator.");
