MGCAddSnippet(921, "A Trace Property computation and reporting program enables conditions for tracing device properties. This optional section of a Trace Property statement consists of a user-provided procedure, which defines the operations that are to take place when values of properties on layout instances are compared to corresponding properties on source instances. ");
MGCAddSnippet(922, "This example shows some primary features of the language. Declaration of PROPERTY or PROPERTY STRING is required. The remainder of the program shows variable assignments, conditional blocks, and function calls the language supports.");
MGCAddSnippet(923, "The following table shows information specific to the Trace Property computation language.");
MGCAddSnippet(924, "Data used in Trace Property computations can come from several sources.");
MGCAddSnippet(925, "Various limitations involving string properties exist in the Trace Property computation and reporting language. ");
MGCAddSnippet(926, "When writing a trace property computation procedure, you may want to check whether a property value is either missing or present prior to doing a test of values.");
MGCAddSnippet(927, "If you use a Trace Property program to replace built-in Trace Property behavior, performance of the LVS comparison phase may be degraded. In one design, mimicking built-in Trace Property behavior with an equivalent program resulted in the overall execution time for LVS growing by a factor of 1.6×. The LVS cumulative comparison execution time grew by a factor of 3.2×. Most of this additional time was spent in the Ambiguity Resolution phase, where the execution time grew by a factor of 3.9×.");
