MGCAddSnippet(942, "This section is provided for historical completeness to show methods used for well proximity calculations. These methods may appear in various process rule files but are not considered the most efficient or current. They are presented to the interested user so that they can be understood when encountered.");
MGCAddSnippet(943, "The enclosure functions, the DFM Property data retrieval functions, and the Device TVF functions are useful for MOS device well proximity computation and similar applications. They are primarily used to extract physical parameters for BSIM4 device models. ");
MGCAddSnippet(944, "The DFM Property operation is useful for calculating complex device properties. It allows attachment of values to polygons in order to report stress effect properties in a netlist.");
MGCAddSnippet(945, "The ENClosure family of built-in functions returns results in arrays. The arrays require special operators to access values.");
MGCAddSnippet(946, "The commands in this section have been historically used to calculate complex device enclosure properties. This information is provided to document functionality you may find in a foundry rule file but is not the currently recommended methodology for calculating well enclosure properties.");
MGCAddSnippet(947, "Returns a vector of numbers that correspond to trapezoidal dimensions of average enclosure distances and widths. ");
