MGCAddSnippet(950, "Returns the sum of vector elements. ");
MGCAddSnippet(951, "DFM functions are used within DFM expressions to create data used in classifying or producing layout objects. The functions are used in the DFM Property family of operations, DFM Analyze, DFM Function, and DFM Spec Fill Optimizer. ");
MGCAddSnippet(952, "DFM Expressions are used to calculate DFM properties, define an analysis or density function, or specify a user-defined function. They can be used to calculate scores, statistics, and measurement values based on layer data. DFM Expressions are used in DFM Analyze, the DFM Property operation family, DFM Function, and DFM Spec Fill Optimizer. ");
MGCAddSnippet(953, "When constructing DFM Expressions, you must follow some basic rules to ensure the expression works as intended.");
MGCAddSnippet(954, "An expression chain is a series of expressions used to define a single DFM property. Expression chains are only used in the DFM Property family of operations. The value of the property is defined as the result of the first expression (evaluated left to right) that was successfully evaluated. An expression chain can be used to assign a default value for a property and protect against evaluation failure. If none of the expressions in the chain are successfully evaluated for a given property name, the expression evaluation fails and the layout object on the primary layer is not copied to the output layer.");
MGCAddSnippet(955, "A conditional expression is a way to specify an if/then expression within a DFM expression—it returns one result if the specified condition is true and another result if the condition is false. You can use conditional expressions in the DFM expressions within DFM Analyze, DFM Spec Fill Optimizer, DFM Property and its related operations, and DFM Function. ");
MGCAddSnippet(956, "You can reference the value of a property computed by a previous property expression within the same operation; this is supported by the DFM Property operation. This is useful if the value of a property is used in other property definitions. Referencing the property improves performance by reducing the number of times the property value is calculated and can make the property expressions simpler to write. ");
MGCAddSnippet(957, "A DFM expression can have multiple elements, such as built-in and user defined functions, variables, and math operators. Some operations can have multiple DFM expressions. It is important to understand the order of expression evaluation. ");
MGCAddSnippet(958, "A DFM expression that does not evaluate successfully has no value and does not satisfy any constraint. When any portion of an expression cannot be evaluated, the overall expression cannot be evaluated. For DFM Property, the primary layer object is not written to the output layer; for DFM Analyze, the capture window is not output. ");
MGCAddSnippet(959, "DFM properties are a form of metadata associated with objects on derived layers. They are often numerical values used for calculating scores and filtering data. Some operations support net number, string, and vector properties. Each property has a name and a value. ");
MGCAddSnippet(960, "Net number properties store the net ID for a geometry. You can create a vector of net IDs. Net number properties have some special restrictions in DFM expressions. ");
MGCAddSnippet(961, "A vector is a two-dimensional array (or matrix) of numbers composed of tuples. Some DFM properties may be vectors. ");
MGCAddSnippet(962, "Non-persistent properties are properties that are not saved to the output layer created by the DFM Property operation. Non-persistent properties are used to filter the input layer(s) when satisfying the constraint is important, but the exact value is not. ");
MGCAddSnippet(963, "DFM properties can be compared with the relational operators: ==, !=, <, <=, >, >=. Numeric, string, numeric vector, and string vector properties can be compared using these operators. Net number and vector net number properties can be compared only for equality (==) or inequality (!=). Care must be taken when testing for equality of floating point values or comparing to an expression that may evaluate to a negative value with a small magnitude. ");
MGCAddSnippet(964, "The ‑validprop command line argument invokes the  property validator , which checks a rule file for missing and unused DFM properties. The ‑validprop argument is only valid with the ‑drc, ‑dfm, ‑lvs, and ‑spice arguments. ");
MGCAddSnippet(965, "Measurement functions calculate the value of a geometric attribute of layer data. Measurement functions return values expressed in user units. Although the COUNT function does not measure a geometric attribute, it is included with the measurement functions because it behaves similarly to the other functions in this class.");
MGCAddSnippet(966, "There are several behaviors to be aware of when using measurement functions in DFM Expressions. Implicit summing over the set of layer objects takes place unless the referenced layer is the primary layer in a DFM Property operation. Implicit summing can be avoided with the use of per-shape functions. Evaluation failure can occur in some cases, causing no result output for the object or capture window. Evaluation failure can be prevented in several ways, such as default values and expression chains. ");
MGCAddSnippet(967, "All measurement functions that return coordinates, or values based upon orientation with respect to a coordinate system, return them in the context of the cell in which the property expression is evaluated. This may not be the same cell in which the geometries originated in cases where promotion occurs. For these functions, the terms x-axis, y-axis, horizontal, and vertical refer to the coordinate system of the evaluation cell, not to the global coordinate system. Cell-context-dependent property functions do not provide predictable results in hierarchical batch runs and should be treated with care.");
MGCAddSnippet(968, "The arithmetic functions SUM, MIN, MAX, and PRODUCT provide per-shape evaluation of the measurement functions in a DFM expression. Per-shape functions are available in DFM Property, DFM Analyze, and DFM Spec Fill Optimizer, with some restrictions depending on the command. Per-shape evaluation applies to the secondary layers in DFM Property and to any layer in DFM Analyze and DFM Spec Fill Optimizer; without a per-shape function the default behavior for those layers is to sum each measurement over all shapes before evaluating the overall expression. ");
MGCAddSnippet(969, "Built-in math operators are available for use in DFM expressions. These are operators familiar in other programming contexts.");
MGCAddSnippet(970, "Certain math functions are supported in DFM Expressions. Math functions take zero or more numeric input arguments and produce a numeric value. There is no compile-time or runtime exception checking on the arguments of these functions, and unreasonable or undefined values may result from certain arguments.");
MGCAddSnippet(971, "DFM expressions can contain certain built-in DFM functions. This section groups the available functions by application and provides a short summary. ");
MGCAddSnippet(972, "This section provides a summary table for DFM measurement functions.");
MGCAddSnippet(973, "The DRC constraint comparison functions are DRC_EQ, DRC_GE, DRC_GT, DRC_LE, DRC_LT, and DRC_NE. These functions have a built-in tolerance of 10e‑8, making them more suitable for use when comparing geometric measurements than the exact double precision comparison operators (==, >=, >, <=, <, and !=).");
MGCAddSnippet(974, "The coordinate access functions measure objects on the input layer and return a coordinate value. The functions are supported in DFM expressions in the DFM Property operation. ");
MGCAddSnippet(975, "The arithmetic functions SUM, MIN, MAX, and PRODUCT provide per-shape evaluation of the measurement functions in a DFM expression. ");
MGCAddSnippet(976, "Depending on the function, the net based functions access node IDs either from connectivity layers or from derived layers containing properties of type netID. Some functions determine maxima or minima from numeric vectors associated with netID vectors, possibly with summation of tuple values. Net based functions rely on connectivity information being present in the referenced layer. The functions are used in DFM expressions. ");
MGCAddSnippet(977, "Certain DFM functions access values of properties that have been defined previously. The functions are divided into two classes. The first class accesses properties defined in the scope of some other layer operation and saved to a layer geometry. The second class, all containing the suffix string _REF, accesses properties within the scope of the same layer operation.");
MGCAddSnippet(978, "String functions create or access string properties in DFM expressions.");
MGCAddSnippet(979, "Several functions allow you to create, manipulate, and access vector data. The vector functions are supported only in DFM expressions in the DFM Property operation. ");
MGCAddSnippet(980, "Several built-in DFM functions do not belong to any particular category and are summarized here. ");
MGCAddSnippet(981, "Many built-in DFM functions are available for use in DFM expressions. The availability of these functions depends on the operation in which the DFM expression appear. The availability of some expression constructs, such as expression chains and conditional expression, also depends on the DFM operation. ");
MGCAddSnippet(982, "The built-in function and DFM expression support for the DFM Property operations with geometric output is summarized here. ");
MGCAddSnippet(983, "The built-in function and DFM expression support for the DFM Property operations with no geometric output is summarized here. ");
MGCAddSnippet(984, "The built-in function and DFM expression support for the DFM Function statement is summarized here. ");
MGCAddSnippet(985, "The built-in function and DFM expression support for DFM Spec Fill Optimizer is summarized here. ");
MGCAddSnippet(986, "The built-in function and DFM expression support for DFM Analyze is summarized here. ");
MGCAddSnippet(987, "This section contains the command reference pages for the DFM functions that are valid in DFM Expressions. ");
MGCAddSnippet(988, "Returns the angle between two edges in an edge cluster. Supported only for DFM Property operations.");
MGCAddSnippet(989, "Returns the area of each polygon on the input layer. For error layers, returns area of the convex hull determined by each edge cluster.");
MGCAddSnippet(990, "Concatenates input vectors into a vector of vectors. Valid only in a DFM Property operation. ");
MGCAddSnippet(991, "Returns the number of objects on the input layer. ");
MGCAddSnippet(992, "The DRC constraint comparison functions are DRC_EQ, DRC_GE, DRC_GT, DRC_LE, DRC_LT, and DRC_NE. These functions have a built-in tolerance of 10e‑8, making them more suitable for use when comparing geometric measurements than the exact double precision comparison operators (==, >=, >, <=, <, and !=). ");
MGCAddSnippet(993, "Performs an equal to (==) comparison with a built-in tolerance of 10e‑8. ");
MGCAddSnippet(994, "Performs a greater than (>) comparison with a built-in tolerance of 10e‑8. ");
MGCAddSnippet(995, "Performs a greater than or equal to (>=) comparison with a built-in tolerance of 10e‑8. ");
MGCAddSnippet(996, "Performs a less than (<) comparison with a built-in tolerance of 10e‑8. ");
MGCAddSnippet(997, "Performs a less than or equal to (<=) comparison with a built-in tolerance of 10e‑8. ");
MGCAddSnippet(998, "Performs a not equal to (!=) comparison with a built-in tolerance of 10e‑8. ");
MGCAddSnippet(999, "The EC functions return the length of one error edge projected onto another (or, the Edge Concurrency). Function variants return the x- and y-axis projection, or constrain one edge to be horizontal or vertical in order for a measurement to be taken. ");
MGCAddSnippet(1000, "Returns the mutual edge projection length (Edge Concurrency) of two error edges, or the length of a single edge. ");
MGCAddSnippet(1001, "Returns the mutual edge projection length of two error edges or the length of a single edge. At least one edge must be horizontal or the function returns 0.");
MGCAddSnippet(1002, "Returns the projection length of EC onto the x-axis, where EC is the mutual edge projection length of two error edges or the length of a single edge.");
MGCAddSnippet(1003, "Returns the mutual edge projection length of two error edges or the length of a single edge. At least one edge must be vertical or the function returns 0. ");
MGCAddSnippet(1004, "Returns the projection length of EC onto the y-axis, where EC is the mutual edge projection length of two error edges or the length of a single edge. ");
MGCAddSnippet(1005, "Returns endpoint coordinates of the EC segment, where EC is the projection of one edge upon another. The functions apply to error layers (edge clusters) with one or two edges per cluster and edge layers. The functions are only supported in DFM Property operations. ");
MGCAddSnippet(1006, "Returns the coordinate of the  beginning  endpoint of the EC segment, where EC is the mutual edge projection length of two edges or the length of a single edge. The beginning endpoint is identified in the originating cell space. Only supported in DFM Property operations. ");
MGCAddSnippet(1007, "Returns the coordinate of the  ending  endpoint of the EC segment, where EC is the mutual edge projection length of two edges or the length of a single edge. The ending endpoint is identified in the originating cell space. Only supported in DFM Property operations. ");
MGCAddSnippet(1008, "Returns the larger value of the two endpoint coordinates of the EC segment, where EC is the mutual edge projection length of two edges or the length of a single edge. Only supported in DFM Property operations. ");
MGCAddSnippet(1009, "Returns the smaller value of the two endpoint coordinates of the EC segment, where EC is the mutual edge projection length of two edges or the length of a single edge. Supported only for DFM Property operations. ");
MGCAddSnippet(1010, "Creates an empty string (  ). Supported only in DFM Property and DFM Function.");
MGCAddSnippet(1011, "Returns the minimum separation distance between edges (or, the Edge Width). To determine minimum separation, the tool finds a pair of points, one on each edge, such that no other point pair is closer together. Function variants return the x- and y-axis projection, constrain one edge to be horizontal or vertical, or require the edges to be parallel in order for a measurement to be taken.");
MGCAddSnippet(1012, "Returns the minimum distance (Edge Width) between each edge pair on the input layer. ");
MGCAddSnippet(1013, "Returns the minimum distance between an edge pair on the input layer if the edges are parallel or fails to evaluate if they are not parallel.");
MGCAddSnippet(1014, "Returns the minimum distance between an edge pair on the input layer if the separation is parallel to the x-axis or 0 otherwise.");
MGCAddSnippet(1015, "Returns projection length on the x-axis of the minimum separation between edges in an edge pair on the input layer.");
MGCAddSnippet(1016, "Returns the minimum distance between an edge pair on the input layer if the separation is parallel to the y-axis, or 0 otherwise.");
MGCAddSnippet(1017, "Returns projection length on the y-axis of the minimum separation between edges in an edge pair on the input layer.");
MGCAddSnippet(1018, "Given a sorted numeric, string, or netID vector, finds the first match to the specified tuple search argument and returns the tuple index. Tuple indexes start at 0. Supported in the DFM Property family of operations.");
MGCAddSnippet(1019, "Returns the net ID associated with a geometry on the input layer as type netID. Supported only for DFM Property and DFM Property Merge operations. The netID returned is based upon the cell placement and provides a netID that can be compared to other netIDs in the context of a cell. Unlike the NETID function, GLOBALNETID takes high shorts into account. ");
MGCAddSnippet(1020, "Returns a length measurement for edges on the input layer. Function variants return the x- and y-axis projection or constrain measured edges be horizontal or vertical. Applicable to derived edge layers only.");
MGCAddSnippet(1021, "Returns the length of each edge on the input layer.");
MGCAddSnippet(1022, "Returns the length of each edge on the input layer that is parallel to the x‑axis.");
MGCAddSnippet(1023, "Returns the length of each edge s projection onto the x-axis. ");
MGCAddSnippet(1024, "Returns the length of each edge on the input layer that is parallel to the y‑axis.");
MGCAddSnippet(1025, "Returns the lengths of each edge s projection onto the y-axis. ");
MGCAddSnippet(1026, "Determines whether or not a string matches a pattern and returns true or false (1 or 0). Valid only in the DFM Property operation.");
MGCAddSnippet(1027, "Computes the maximum of an expression over a set of layer objects. Valid in DFM Property and DFM Analyze. ");
MGCAddSnippet(1028, "Computes the minimum of an expression over a set of layer objects. Valid in DFM Property and DFM Analyze. ");
MGCAddSnippet(1029, "Accesses values on a Net Area Ratio Accumulate (NARAC) layer. Supported only in the DFM Property operation.");
MGCAddSnippet(1030, "Returns the net ID associated with a geometry on the input layer as type netID. Supported only for DFM Property and DFM Property Merge operations. Connectivity is considered for the cell the property expression is evaluated in and that cell s descendants; connectivity at a higher level in the hierarchy is not considered.");
MGCAddSnippet(1031, "Returns a string containing the net name for the specified netID. Supported in the DFM Property and DFM Property Select Secondary operations.");
MGCAddSnippet(1032, "Accesses DFM properties of type netID from objects on the input layer. Supported only in DFM Property and DFM Function.");
MGCAddSnippet(1033, "References the value of a net number (netID) property that was previously defined in the same operation. Used only in DFM Property. ");
MGCAddSnippet(1034, "Returns the specified element of a netID vector. Supported for the DFM Property family of operations. ");
MGCAddSnippet(1035, "Accesses DFM properties of type vnetID (vector of net IDs) from objects on the input layer. Supported only in DFM Property and DFM Function.");
MGCAddSnippet(1036, "References the value of a vector of net number properties (vnetID) that was previously defined in the same operation. Used only in DFM Property. ");
MGCAddSnippet(1037, "Creates a vector of netID values. It is most useful in DFM Property Select Secondary, where it creates one tuple for each cluster that is grouped with the select geometry.");
MGCAddSnippet(1038, "Accesses net-indexed numeric property values from the input layer. Supported in DFM Property and DFM Property Select Secondary.");
MGCAddSnippet(1039, "Returns the net ID value NONETID. Supported only in DFM Property and DFM Property Net.");
MGCAddSnippet(1040, "Acts as a transformation function that shifts the first elements of input vector tuples by a fixed amount. By default, the shift is to the ordinate axis of the vector data space. The transformation removes the dependence of the input data on the coordinates of particular geometries, and allows placement-independent characterization and comparison of the vector values.");
MGCAddSnippet(1041, "Returns a sum of the edge lengths for each polygon on the input layer. Applicable to original or derived polygon layers. ");
MGCAddSnippet(1042, "Returns the sum of edge lengths for each polygon on the input layer. ");
MGCAddSnippet(1043, "Returns the sum of edge lengths parallel to the x-axis for each polygon on the input layer. ");
MGCAddSnippet(1044, "Returns the sum of lengths of edge projections onto the x-axis for each polygon on the input layer. ");
MGCAddSnippet(1045, "Returns the sum of edge lengths parallel to the y-axis for each polygon on the input layer. ");
MGCAddSnippet(1046, "Returns the sum of lengths of edge projections onto the y-axis for each polygon on the input layer. ");
MGCAddSnippet(1047, "Returns the value of the Precision specification statement in the SVRF rule file.");
MGCAddSnippet(1048, "Given an input property vector of sorted netID values, returns a vector that is sorted at the hierarchy level in which the expression evaluation takes place. ");
MGCAddSnippet(1049, "Computes the product of an expression over a set of layer objects. Valid in DFM Property, DFM Analyze, and DFM Spec Fill Optimizer. ");
MGCAddSnippet(1050, "Accesses numeric DFM properties from objects on the input layer.");
MGCAddSnippet(1051, "References the value of a numeric property that was previously defined in the same operation. Used only in DFM Property. ");
MGCAddSnippet(1052, "Generates string properties corresponding to node IDs on input layer shapes. When an input shape is promoted, the output string contains the prefix Xm/Xn/.../<ID>, where n, m, and so forth are placement numbers of the instances in the hierarchy where the associated net shape originates. The returned netID is valid in the context of the cell in which the geometry originates. This function supports all layer clustering modes. Used only in DFM Property or DFM Function.");
MGCAddSnippet(1053, "Accesses a string type property from an object on the input layer. The returned string is prefixed by Xn/Xm/.../ to indicate placement hierarchy. Supported only for DFM Property and DFM Function.");
MGCAddSnippet(1054, "References the value of a string property that was previously defined in the same operation; the returned string is prefixed by Xn/Xm/.../ to indicate placement hierarchy. Used only in DFM Property. ");
MGCAddSnippet(1055, "Returns a pseudo-random number between 0.0 and 1.0, with 32 bits of significance. Can be used in any DFM expression context. ");
MGCAddSnippet(1056, "Computes a vector of tuples, with each tuple containing a coordinate point value and associated measurement values from the input vector. The coordinate values of the output tuples must be within a specified interval.");
MGCAddSnippet(1057, "Computes the nth smallest measurement values associated with coordinate intervals contained in a set of input vectors. Outputs the selected measurement values with associated interval coordinates from each of the input vectors in vector form.");
MGCAddSnippet(1058, "Performs a lexicographic (dictionary) sort on the input vector. Supported for the DFM Property family of operations. ");
MGCAddSnippet(1059, "Returns a one dimensional vector of index values. The index values map the results of the function SORT() on the input vector back to the input vector indices. Supported for the DFM Property family of operations. ");
MGCAddSnippet(1060, "Computes minimum measurement values associated with coordinate intervals contained in a set of input vectors. Outputs the minimum measurement values with associated interval coordinates in vector form.");
MGCAddSnippet(1061, "Performs a lexicographic (dictionary) sort of the input vector and then removes duplicate tuples. Supported for the DFM Property family of operations. ");
MGCAddSnippet(1062, "Returns a one dimensional vector of index values. The index values map the results of the function SORT_UNIQUE() on the input vector back to the input vector indices. Supported for the DFM Property family of operations. ");
MGCAddSnippet(1063, "Accesses string type properties from objects on the input layer. Supported only for DFM Property and DFM Function.");
MGCAddSnippet(1064, "References the value of a string property that was previously defined in the same operation. Used only in DFM Property. ");
MGCAddSnippet(1065, "Computes the sum of an expression over a set of layer objects. Valid in DFM Property, DFM Analyze, and DFM Spec Fill Optimizer. ");
MGCAddSnippet(1066, "Returns the specified element in a vector of strings. Supported for the DFM Property family of operations. ");
MGCAddSnippet(1067, "Accesses DFM properties that are vectors of strings from objects on the input layer. Supported only for DFM Property and DFM Function.");
MGCAddSnippet(1068, "References the value of a vector of strings property that was previously defined in the same operation. Used only in DFM Property. ");
MGCAddSnippet(1069, "Creates a vector of string type properties. It is most useful in DFM Property Select Secondary, where it creates one tuple for each cluster that is grouped with the select geometry.");
MGCAddSnippet(1070, "Removes equal adjacent tuples from the input vector. Supported in the DFM Property family of operations.");
MGCAddSnippet(1071, "Returns the number of unique elements in a vector. Supported in the DFM Property family of operations.");
MGCAddSnippet(1072, "Returns a one dimensional vector of index values. The index values map the results of the function UNIQUE() on the input vector back to the input vector indices. Supported for the DFM Property family of operations. ");
MGCAddSnippet(1073, "Returns the net ID occurring most often in a vector of net IDs. Additionally can determine the maximum numeric value in one vector and return the corresponding net ID from another vector. The third variant computes sums of numeric values in one vector corresponding to net IDs in another vector. The net ID corresponding to the greatest sum is returned. Used only in DFM Property and DFM Function.");
MGCAddSnippet(1074, "Returns the net ID occurring least often in a vector of net IDs. Additionally can determine the minimum numeric value in one vector and return the corresponding net ID from another vector. The third variant computes sums of numeric values in one vector corresponding to net IDs in another vector. The net ID corresponding to the least sum is returned. Used only in DFM Property and DFM Function.");
MGCAddSnippet(1075, "Creates a vector of numeric type properties. Supported only in DFM Property and DFM Property Merge operations. ");
MGCAddSnippet(1076, "Returns the specified element of a numeric vector. Supported for the DFM Property family of operations. ");
MGCAddSnippet(1077, "Determines the maximum value in a specified slice of a vector tuple. Additionally can determine the tuple index of a maximum value of a specified slice and use that index to return a corresponding value in another slice, possibly in another vector. Supported only in the DFM Property operation.");
MGCAddSnippet(1078, "Determines the minimum value in a specified slice of a vector tuple. Additionally can determine the tuple index of a minimum value of a specified slice and use that index to return a corresponding value in another slice, possibly in another vector. Supported only in the DFM Property operation. ");
MGCAddSnippet(1079, "Creates a vector of netID values. Supported only for the DFM Property operation.");
MGCAddSnippet(1080, "Determines the tuple index of a maximum value of a specified slice in one vector and uses that index to return a corresponding element (a net ID) in another slice of another vector. Supported only in the DFM Property operation.");
MGCAddSnippet(1081, "Determines the tuple index of a minimum value of a specified slice in one vector and uses that index to return a corresponding element (a net ID) in another slice of another vector. Supported only in the DFM Property operation.");
MGCAddSnippet(1082, "Returns the sum of numeric values in a slice (column) of one vector corresponding to net IDs in a slice of another vector, where the net IDs match a specified net ID. The simpler form of the function is a shortened version of the longer one and assumes slice index values of 0. Used only in DFM Property and DFM Function.");
MGCAddSnippet(1083, "Accesses vector type DFM properties from objects on the input layer. Supported only with DFM Property operations and DFM Function.");
MGCAddSnippet(1084, "References the value of a numeric vector property that was previously defined in the same operation. Used only in DFM Property. ");
MGCAddSnippet(1085, "Creates a vector of string type properties. Used only in DFM Property and DFM Function.");
MGCAddSnippet(1086, "Creates a vector of numeric type properties. It is most useful in DFM Property Select Secondary, where it creates one tuple for each cluster that is grouped with the select geometry. ");
MGCAddSnippet(1087, "Tcl Verification Format (TVF) is a programmable extension to the Standard Verification Rule Format (SVRF) language for Calibre. TVF is employed in two distinct environments: compile-time and runtime. TVF uses all standard Tcl constructs, which provides a uniform programming structure.");
MGCAddSnippet(1088, "When using compile-time or runtime TVF in conjunction with Calibre nmDRC or Calibre nmLVS, Calibre requires no additional licenses. If you are preprocessing a TVF file using the calibre -E option, the appropriate licenses must be available for the statements used in your TVF file.");
MGCAddSnippet(1089, "Before using TVF, you should be aware of some fundamental differences between Tcl and SVRF. Tcl and SVRF have conflicting interpretations of certain language features including several command names, character usage, whitespace, case-sensitivity, and so forth. ");
MGCAddSnippet(1090, "Compile-time TVF appears in a special rule file that has a script of compile-time TVF commands. This script is interpreted and translated directly into SVRF code, one line at a time, upon execution of the Calibre command. Compile-time TVF does not access data during the Calibre run.");
MGCAddSnippet(1091, "A compile-time TVF file is a Tcl script and must follow standard Tcl formatting rules. ");
MGCAddSnippet(1092, "SVRF specification statements and layer operations are handled differently in TVF commands due to the different way in which the commands can appear in the SVRF language. ");
MGCAddSnippet(1093, "A compile-time TVF file includes a required opening line and elements for layer definitions, specification statements, rule checks, comments, and other TVF commands. The file can include Tcl procs and standard Tcl constructs such as loops, conditional statements, and lists. ");
MGCAddSnippet(1094, "This section summarizes the elements and commands that can appear in a compile-time TVF file. The opening line must be the first line in the file but all other elements may be in any order. ");
MGCAddSnippet(1095, "The opening line of a compile-time TVF script must begin with the string  #!tvf . This instructs Calibre to use the TVF preprocessor to interpret the script.");
MGCAddSnippet(1096, "Most SVRF specification statements, device extraction statements, connectivity extraction operations, and fracture operations are mapped to TVF commands. The initial keyword of the statement is mapped to a command in the tvf:: namespace, with remaining secondary keywords and parameters passed in as arguments. Most layer operations are not mapped to TVF commands but handled instead with the tvf::SETLAYER and tvf::OUTLAYER functions.");
MGCAddSnippet(1097, "The PEX Inductance family of statements is not mapped to TVF. This is the only family of specification statements for which this is true. Most layer operations are not mapped to TVF commands. ");
MGCAddSnippet(1098, "The SVRF @ and // comment characters are mapped to compile-time TVF commands. ");
MGCAddSnippet(1099, "The tvf::SETLAYER command is used to assign derived layers to a new layer name. ");
MGCAddSnippet(1100, "The SVRF rule check construct is handled with the tvf::RULECHECK command in compile-time TVF. Rule checks in SVRF have user-given names, so the SVRF syntax cannot be used in TVF. ");
MGCAddSnippet(1101, "Global variables allow you to share variables between Tcl interpreters, encrypted and unencrypted. Compile-time TVF includes several commands for handling global variables. ");
MGCAddSnippet(1102, "Care must be taken to properly handle special characters in compile-time TVF code so that the special characters are translated correctly to SVRF statements. ");
MGCAddSnippet(1103, "Some differences between SVRF and Tcl coding should be kept in mind when coding compile-time TVF scripts. In addition, Tcl special characters appearing within a SVRF statement must be escaped with a backslash.");
MGCAddSnippet(1104, "Compile-time TVF allows you to pass SVRF code directly to the SVRF compiler without change. You should use verbatim code as much as possible in your compile-time TVF scripts to include blocks of SVRF code that do not need to be changed to TVF syntax. ");
MGCAddSnippet(1105, "It is generally easiest to pass the runtime TVF elements in a compile-time script using the tvf::VERBATIM command. However, the runtime element TVF Function is implemented as a compile-time command and can appear outside of a VERBATIM command. Some special characters need special handling. ");
MGCAddSnippet(1106, "In some cases, it may be desirable to add quotation marks for pathnames in commands. This requires the use of escape characters in compile-time TVF.");
MGCAddSnippet(1107, "The comment string in the tvf::@, tvf:://, and tvf::COMMENT commands is evaluated by the Tcl interpreter, and therefore requires some special care. ");
MGCAddSnippet(1108, "Single quotes are not special characters in Tcl and are passed through to the SVRF output; however, the blanks between the single quotes are not protected. If such blanks are important to maintain, they should be protected by double quotes or braces. ");
MGCAddSnippet(1109, "A Calibre run with a compile-time TVF rule file is started in the same manner as with a SVRF rule file. The opening line in the compile-time TVF rule file instructs Calibre to use the TVF preprocessor. Additional command line options are available to pass arguments to the TVF script, enable additional error reporting, or write the generated SVRF code to a file.");
MGCAddSnippet(1110, "The Calibre command line has several options for use with compile-time TVF rule files. ");
MGCAddSnippet(1111, "A user-supplied command line argument can be passed into a compile-time TVF script by using the -tvfarg command line option. The command line itself can be accessed with the global variables calibre_argc, calibre_argv, and calibre_argv0.");
MGCAddSnippet(1112, "The TVF rule file is written to the transcript, followed by the runtime information. The translated SVRF code is not written to the transcript by default. Several commands are available to control the transcript output.");
MGCAddSnippet(1113, "The command line option ‑tvf_instrument enables extra error reporting in compile-time TVF runs. If you want to only see error reporting for an error at a specific line, you can use the tvf::set_traceback_line command. The tvf::insert_tvf_line_info command can also be used. ");
MGCAddSnippet(1114, "Calibre runs compile-time TVF with extra error reporting with the -tvf_instrument command line option. When it is used, TVF errors are reported with the file name and line number. If an error occurs in SVRF code generated out of compile-time TVF, the original TVF location that produced the offending SVRF statement is reported. You can also have a comment inserted into the generated SVRF file using the tvf::insert_tvf_line_info command. ");
MGCAddSnippet(1115, "SVRF syntax errors can be traced without the -tvf_instrument command line option. This can be done by tracing the line number reported by the SVRF compiler and using the tvf::set_traceback_line command. ");
MGCAddSnippet(1116, "The examples in this section show how to use compile-time TVF with Tcl loops and procedures to generate a set of rule checks. ");
MGCAddSnippet(1117, "This is an example of a for loop, showing basic checks for four layers of vias.");
MGCAddSnippet(1118, "This example shows a foreach loop, which passes width, spacing, and enclosure parameters for five layers of metal.");
MGCAddSnippet(1119, "This example shows the definition of a Tcl proc. The procedure in this example shows width and spacing checks. The calls to the procedure at the end of the example pass the values for the layer, Space, and Width variables.");
MGCAddSnippet(1120, "This compile-time TVF script shows how you can derive layers with TVF and simplify derivations.");
MGCAddSnippet(1121, "The following compile-time TVF script shows how you can pass an environment variable into a layer derivation. To run this script, you must first set the environment variable  mycell  to the cellname  bit .");
MGCAddSnippet(1122, "The following compile-time TVF script contains a procedure that accepts original or derived layer names as input and generates rules that copy each layer.");
MGCAddSnippet(1123, "The following compile-time TVF script contains a procedure that accepts original GDS layer numbers as input and generates both LAYER statements and rules to copy the original layers out:");
MGCAddSnippet(1124, "Runtime TVF is Tcl code that appears within a special SVRF element called TVF Function. Runtime TVF allows you to access data generated during a Calibre run.");
MGCAddSnippet(1125, "Defines a function block of Tcl code. ");
MGCAddSnippet(1126, "Calls a TVF Function and passes layer parameters to it, then generates a single output layer based upon one or more input layers.");
MGCAddSnippet(1127, "This is a simple example to introduce the forms of the SVRF elements supporting runtime TVF.");
MGCAddSnippet(1128, "Embedded brackets [ ] in Tcl commands within a TVF Function block cause the SVRF compiler to report a syntax error (SYN2) at the initial line number of the TVF Function. A similar error occurs for embedded brackets in a TVF layer operation. This is because the brackets are special characters in SVRF. This error can be avoided in several ways.");
MGCAddSnippet(1129, "Layers in runtime TVF are variable handles. Layer handles are used by various commands within the TVF Function that manipulate layer data.");
MGCAddSnippet(1130, "Runtime TVF commands consist of layer functions, supported layer operations, variable functions, and application specific functions. ");
MGCAddSnippet(1131, "Several layer functions are provided for runtime TVF operation. The functions are summarized here. They perform layer derivation, layer output, get layer extent, get the layer name, and other functions. ");
MGCAddSnippet(1132, "This example defines a TVF Function that is called by the TVF Layer operation. The L1, L2, and L3 arguments correspond to layer1, layer2, and layer3.");
MGCAddSnippet(1133, "Runtime TVF supports a limited set of SVRF layer operations. ");
MGCAddSnippet(1134, "You can access variables defined with the SVRF Variable statement using the tvf::svrf_var statements. You can also make use of global Tcl variables and the initialization section of the TVF layer operation. ");
MGCAddSnippet(1135, "There are a number of system variables declared in the rule file that runtime TVF can access. The variables are accessed with the tvf::sys_var command. ");
MGCAddSnippet(1136, "The only comment character allowed within a runtime TVF script is #. ");
MGCAddSnippet(1137, "This section includes several example for runtime TVF. ");
MGCAddSnippet(1138, "The following shows an example of testing some typical SVRF layer derivations against TVF derivations that should produce identical results.");
MGCAddSnippet(1139, "This example shows a while loop.");
MGCAddSnippet(1140, "Compile-time TVF can be used to pass runtime TVF syntax as is shown in this example. You pass the filename of a text file as a parameter to the TVF layer operation. This text file is then read by the TVF Function to establish variable settings within the function.");
MGCAddSnippet(1141, "Calibre normally prints the SVRF lines that are specified by the rule file after they are loaded into the SVRF compiler. However, runtime TVF code is not processed by the SVRF compiler; therefore, calls to layer operations made from a TVF Function are not output by default. To enable the echoing of all layer operation calls to stdout, add the following line to the TVF Function script: ");
MGCAddSnippet(1142, "Runtime TVF errors are reported by the Tcl preprocessor in all applications except Device TVF, which reports errors at compilation time.");
MGCAddSnippet(1143, "All TVF commands begin with the tvf:: prefix. In practice, starting every line with tvf:: can become tedious. You can import available commands from the TVF namespace using the following Tcl command:");
MGCAddSnippet(1144, "TVF supports global variables that store values from the Calibre invocation line, analogous to argc and argv. These global variables are available for both compile-time and runtime TVF.");
MGCAddSnippet(1145, "Compile-time and runtime TVF commands are described in this section. A table lists the commands available in both compile-time and runtime TVF, along with a short description.");
MGCAddSnippet(1146, "Specifies a single-line user-supplied comment that does not affect code execution.");
MGCAddSnippet(1147, "Specifies a single-line user-supplied comment within a rule check (a rule check comment). Can also be specified with tvf::COMMENT. ");
MGCAddSnippet(1148, "Disables echoing to the output rule file specified with the -E command line option and disables the transcript output produced by SVRF commands.");
MGCAddSnippet(1149, "Specifies a single-line user-supplied comment within a rule check (a rule check comment). Identical to the tvf::@ command for rule comments.");
MGCAddSnippet(1150, "Identical to the SVRF Copy operation. ");
MGCAddSnippet(1151, "Deletes the specified layer. Subsequent references to the specified layer return an error. This command is useful for reducing peak memory usage by removing temporary layers from the run.");
MGCAddSnippet(1152, "Writes a string to the output location specified by the tvf::echo_svrf command. ");
MGCAddSnippet(1153, "Specifies whether to echo the SVRF commands created from translating the TVF file. The transcript is echoed to either stdout (the default) or to a file. ");
MGCAddSnippet(1154, "Writes a string directly to the output SVRF file. This command is used to customize SVRF output generated in pre-processor mode. The effects of this command are only seen in the SVRF file saved with the -E command line option. ");
MGCAddSnippet(1155, "An internal procedure that automatically cleans up temporary and deleted layers. You may see this command echoed in debug statements.");
MGCAddSnippet(1156, "Checks for the existence of a global variable. Global variables allow you to share variables between Tcl interpreters, encrypted and unencrypted. Returns 1 if the variable exists, 0 otherwise.");
MGCAddSnippet(1157, "Returns the Calibre version you are running.");
MGCAddSnippet(1158, "Retrieves the value of a global TVF variable. Global variables allow you to share variables between Tcl interpreters, encrypted and unencrypted. Returns the values of the global variable if it exists and returns    otherwise.");
MGCAddSnippet(1159, "Imports the layers passed to a TVF Function by a TVF layer operation, and sets up the layer handles. This command must be used once in a TVF Function statement that is called by a TVF layer operation.");
MGCAddSnippet(1160, "Gets the argument specified with the -tvfarg command line option. ");
MGCAddSnippet(1161, "Returns the bounding box of the extent of the layer.");
MGCAddSnippet(1162, "Returns the layer name for the specified layer handle. The layer name is more useful in debugging statement than the layer handle.");
MGCAddSnippet(1163, "Inserts a comment into the generated SVRF file with the line number of the corresponding command in the compile-time TVF file. ");
MGCAddSnippet(1164, "Determines if a layer is empty.");
MGCAddSnippet(1165, "Determines if the transcript output is blocked. Returns a value of 1 if transcript output is currently blocked or 0 if not blocked.");
MGCAddSnippet(1166, "Specifies a layer operation in compile-time and runtime TVF and outputs the results. The output method depends on whether the command is called in runtime or compile-time TVF.");
MGCAddSnippet(1167, "Writes a string to output. The string is written to the output location specified for tvf::echo_svrf and to the file specified with the -E command line option, if present. ");
MGCAddSnippet(1168, "Prints a trace of all TVF layer operation calls during runtime.");
MGCAddSnippet(1169, "Denotes a Calibre nmDRC rule check in compile-time TVF. ");
MGCAddSnippet(1170, "The included TVF code is run in encrypted mode with the specified encryption id string. ");
MGCAddSnippet(1171, "Writes a formatted header to the top of the SVRF output file and replaces the default header. This command, if used, must be the first command specified in the top-level compile-time TVF script. The effects of this command are only seen in the SVRF file saved with the -E command line option.");
MGCAddSnippet(1172, "Sets the value of a TVF global variable given its name and optional index values. Global variables allow you to share variables between Tcl interpreters, encrypted and unencrypted. The variable is created if it does not exist. Returns 1 on success, 0 otherwise.");
MGCAddSnippet(1173, "Controls indentation of each rule check printed in the output SVRF file (the default is a tab). The indentation parameter is a string that is prepended to each line. The effects of this command are only seen in the SVRF file saved with the -E command line option. ");
MGCAddSnippet(1174, "Used to trace SVRF syntax errors at a specified line in the generated SVRF rule file to line numbers in your TVF rule file. ");
MGCAddSnippet(1175, "Used for layer derivation in both compile-time and runtime TVF. The command executes a layer operation and stores the output in a specified layer. Options are available in compile-time TVF to return a list of layers that were derived using the SETLAYER command and to return the layer operation expression for a given layer.");
MGCAddSnippet(1176, "Gets the value of a variable defined with the Variable statement in the SVRF rule file. This statement gives the runtime TVF Function block access to variables defined with the Variable statement.");
MGCAddSnippet(1177, "Accesses the value of a system variable in runtime TVF.");
MGCAddSnippet(1178, "Ends transcript blocking set with tvf::block_transcript. Output to the transcript and to the rule file specified with the -E command line option is resumed.");
MGCAddSnippet(1179, "Clears a global variable. Global variables allow you to share variables between Tcl interpreters, encrypted and unencrypted. Returns 1 if the global variable existed prior to calling this function, 0 otherwise.");
MGCAddSnippet(1180, "Passes in verbatim SVRF code in a compile-time TVF script. The contents of the VERBATIM code block are passed directly to the SVRF compiler, without going through the Tcl interpreter. ");
